import React, { Component } from 'react';
import PropTypes from 'prop-types';
import { connect } from 'react-redux';

export const ProfileDetails = ({ details }) => {
    return (
        <section className='tile'>
            <table className='details-table'>
                <caption className='sr-only'>
                    <h2 className='sr-only'>Profile Details.</h2>
                </caption>
                <thead>
                    <tr className='sr-only'>
                        <th scope='col'>Add task to a new invoice</th>
                        <th scope='col'>Description</th>
                        <th scope='col'>Value</th>
                        <th scope='col'>Move Item Up</th>
                        <th scope='col'>Move Item Down</th>
                    </tr>
                </thead>
                <tbody>
                    {details
                        .filter((item) => item.value)
                        .map((item) => {
                            return (
                                <tr key={item._id}>
                                    <th scope='row'>{item.label}</th>
                                    <td>{item.value}</td>
                                    <td
                                    // onClick={() => {
                                    //     task.addToNextInvoice = !addToNextInvoice;
                                    //     toggleTaskInvoiceDisplay(_id, task);
                                    // }}
                                    >
                                        <button
                                            onMouseDown={(e) =>
                                                e.preventDefault()
                                            }
                                        >
                                            {item.show ? (
                                                <b>&#45;</b>
                                            ) : (
                                                <b>&#43;</b>
                                            )}
                                        </button>
                                    </td>
                                    <td>
                                        <button
                                            onMouseDown={(e) =>
                                                e.preventDefault()
                                            }
                                        >
                                            Up
                                        </button>
                                    </td>
                                    <td>
                                        <button
                                            onMouseDown={(e) =>
                                                e.preventDefault()
                                            }
                                        >
                                            Down
                                        </button>
                                    </td>
                                </tr>
                            );
                        })}
                </tbody>
            </table>
        </section>
    );
};

ProfileDetails.propTypes = {};

const mapStateToProps = (state) => ({
    details: state.profile.details,
});

const mapDispatchToProps = {};

export default connect(mapStateToProps, mapDispatchToProps)(ProfileDetails);
